# ## <a id="51">LeNet5 Model Architecture</a>

# ![image.png](attachment:image.png)

# ![lenet_5.gif](data:image/gif;base64,)

# **LeNet-5 has following features:**
# 
# * No. of filters of each CONV layer are: C1 = 6, C3 = 16, C5 = 120 layers.
# * Kernel size of each layers is 5 x 5.
# * A subsampling POOL layer is added after each subsequent CONV layer. It's receptive field is 2 x 2 & this pooling is average pooling rather than the max pooling.
# * Activation function used: tanh(x) [But I have used 'relu' for better accuracy]
# * Last layer is a Dense Layer with activation func: softmax

# * https://keras.io/examples/vision/mnist_convnet/#build-the-model
# * https://medium.com/@siddheshb008/lenet-5-architecture-explained-3b559cb2d52b

# In[40]:


# Building the Model Architecture
model = keras.models.Sequential([
# Select 6 feature convolution kernels with a size of 5 * 5 (without offset), and get 66 feature maps.
# The size of each feature map is 32−5 + 1 = 2832−5 + 1 = 28.
# That is, the number of neurons has been reduced from 10241024 to 28 ∗ 28 = 784 28 ∗ 28 = 784.
# Parameters between input layer and C1 layer: 6 ∗ (5 ∗ 5 + 1)
          keras.layers.Conv2D(filters=6, kernel_size=5, 
                              strides=1, activation='relu', 
                              input_shape=(28,28,1), padding='same'),
# The input of this layer is the output of the first layer, which is a 28 * 28 * 6 node matrix.
# The size of the filter used in this layer is 2 * 2, and the step length and width are both 2,
# so the output matrix size of this layer is 14 * 14 * 6.
          keras.layers.AveragePooling2D(pool_size=2, strides=2, padding='same'),
# The input matrix size of this layer is 14 * 14 * 6, the filter size used is 5 * 5, and the depth is 16.
# This layer does not use all 0 padding, and the step size is 1.
# The output matrix size of this layer is 10 * 10 * 16. This layer has 5 * 5 * 6 * 16 + 16 = 2416 parameters
          keras.layers.Conv2D(filters=16, kernel_size=5, 
                              strides=1, activation='relu',padding='valid'),
# The input matrix size of this layer is 10 * 10 * 16.
# The size of the filter used in this layer is 2 * 2, and the length and width steps are both 2,
# so the output matrix size of this layer is 5 * 5 * 16.
          keras.layers.AveragePooling2D(pool_size=2, strides=2, padding='valid'),
# The input matrix size of this layer is 5 * 5 * 16. This layer is called a convolution layer in the LeNet-5 paper,
# but because the size of the filter is 5 * 5,
# So it is not different from the fully connected layer. If the nodes in the 5 * 5 * 16 matrix are pulled into a vector,
# then this layer is the same as the fully connected layer.
# The number of output nodes in this layer is 120, with a total of 5 * 5 * 16 * 120 + 120 = 48120 parameters.
          keras.layers.Conv2D(filters=120, kernel_size=5, 
                              strides=1, activation='relu',padding='valid'),
# The number of input nodes in this layer is 120 and the number of output nodes is 84.
# The total parameter is 120 * 84 + 84 = 10164 (w + b)                              
          keras.layers.Flatten(),
          keras.layers.Dropout(0.5),
          keras.layers.Dense(units=84, activation='relu'),
# The number of input nodes in this layer is 84 and the number of output nodes is 10.
# The total parameter is 84 * 10 + 10 = 850
          keras.layers.Dense(units=10, activation='softmax')
])

model.summary()


