# # Plotting Accuracy & Loss

# In[55]:


# Plotting Accuracy & Loss  
def ACC_Loss_plot(history):

  f, ax = plt.subplots(1, 2, figsize=[18, 8])
  ax[0].plot([None] + history.history['accuracy'], 'o-')
  ax[0].plot([None] + history.history['val_accuracy'], 'x-')
  # Plot legend and use the best location automatically: loc = 0.
  ax[0].legend(['Train acc', 'Validation acc'], loc = 0)
  ax[0].set_title('Training/Validation acc per Epoch')
  ax[0].set_xlabel('Epoch')
  ax[0].set_ylabel('acc')

  ax[1].plot([None] + history.history['loss'], 'o-')
  ax[1].plot([None] + history.history['val_loss'], 'x-')

  # Plot legend and use the best location automatically: loc = 0.
  ax[1].legend(['Train loss', "Val loss"], loc = 0)
  ax[1].set_title('Training/Validation Loss per Epoch')
  ax[1].set_xlabel('Epoch')
  ax[1].set_ylabel('Loss')

  plt.tight_layout()
  plt.show()


